import React from 'react'
import Button from '@mui/material/Button';
import './More.css'

function More() {
  return (
    <div className="options-container">
      <Button 
        style={{
        top: "-150px",
        color:"#fff",
        width:"100px",
        height:"100px",
        borderColor: 'white',
        backgroundColor: "#5c5a5a",
        padding: "26px 26px",
        fontSize: "18px"
    }}
      >
          Notify Now
      </Button>
    
    
    
    
    </div>
    
  )
}

export default More
